void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = fragCoord/iResolution.xy;
    float s = 32.0;
    // Time varying pixel color
    vec3 col = 3.0*cos(iTime+uv.xyx*vec3(s*sin(iTime*0.05),s*cos(iTime*0.12),s*cos(uv.x+iTime*0.66)));
       col = abs(col) - texture(iChannel0, uv).xxx;
    // Output to screen
    fragColor = vec4(vec3(col.x*col.y*col.z),1.0);
}
